(72, 'Trad', 'Hamdan', 'N/a', 'thamdan@quest-comm.com', '$2y$10$Mp5QqZo1fpsTybZH9U17r.nOtrFXMcXTifO4yqNRTVEBXE2c2BGH2', 'assets/admin/images/1252871017.jpg', 'N/A', '5361 NW 81st Terr', '', 'Lauderhill', 'FL', 'United States', '33351', '9895', '(954) 554-0503', 'Individual', '', NULL, '', 'Beyondant, LLC, is the leader in usable NFC devices, deploying wireless data transfer methods that detect and enable technology in close secured proximity to direct your customer/prospects to a desired Internet destination. The coronavirus has now changed the way we conduct business. Social Distancing is the new normal. In the times of COVID-19, paper business cards and handshaking with the clients is a great risk that can put your life in danger. Our solution of contact-free digital business cards is in high demand because it is easy, fast, and works seamlessly with ironclad security features with just a smartphone tap on any of our devices, thereby eliminating the need for physical exchanges. We provide you with an opportunity to have a digital business card and build a huge network easily. Evolved from radio frequency identification (RFID) technology, our various devices, and applications are reshaping our world. Nowadays, going digital have a lot of advantages e.g. you can update your card, share it, and leave an ever-lasting impact on your clients. With Beyondant cards you can change your information keenly, suppose you have to change your email address, in case, you are using paper businesses card you have to change and re-print the card but if you are using Beyondant digital business cards, you can customize it anytime quickly. You will not find any difficulty using the digital method if you have an NFC tag iPhone or have enabled your apple iPhone NFC.', NULL, 0, 0, 'The World', NULL, NULL, 'N/A', '2020-08-25 00:00:00', 'n/a', 0, 0, 'Trad76', 'Iron', 'Trad Hamdan', 1, '2020-08-25 18:17:33', '2020-08-25 21:03:12'),
